Certainly! A simple solution for port scanning in Go can look like this:

```go
package main

import (
	"fmt"
	"net"
)

// Function to scan open ports given an IP and start / end port range
func scanPort(ip string, startPort, endPort int) {
	for port := startPort; port <= endPort; port++ {
		target := fmt.Sprintf("%s:%d", ip, port)

		conn, err := net.Dial("tcp", target)
		if err == nil {
			fmt.Printf("Port %d open\n", port)
			conn.Close()
		}
	}
}

func main() {

	// Replace localhost to target IP address if needed
	ip := "localhost"

	// Defining port range between 1 to 100 ports
	startPort := 1
	endPort := 100

	fmt.Printf("Scanning ports %d - %d on %s\n", startPort, endPort, ip)
	scanPort(ip,  startPort, endPort)
}
```

